import React from "react";
import "./menu-iten.style.css";

const MenuItem = () => {
  return (
    <div className="menu-item">
      <div>
        <h2 className="title">Title</h2>
        <img src="" alt="" />
        <span className="subtitle">Pruebalo ya</span>
      </div>
    </div>
  );
};

export default MenuItem;
